import React from 'react';
import './App.css';
import PromptDisplay from './Components/prompt-container';
import SqlDisplay from './Components/sql-display';

function App() {
  return (
    <div className="App">
      <PromptDisplay/>
      <input/>
      <SqlDisplay/>
      <div className='buttons'>
        <button id='generate-code'>
          Generate Sql Code
        </button>
        <button id='clear-chat'>
          Clear Chat
        </button>
      </div>
    </div>
  );
}

export default App;
